Ext.data.JsonP['Titanium_SDK_4.1.1_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Titanium SDK 4.1.1 General Availability - 09 September 2015</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46239779\" class=\"content\">\n                        <h1>Titanium SDK 4.1.1 General Availability - 09 September 2015</h1>\n    <div class=\"section section-2 \" id=\"src-46239779_TitaniumSDK4.1.1ReleaseNote-Contents\">\n        <h2 class=\"heading \"><span>Contents</span></h2>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_4.1.1_Release_Note-section-src-46239779_TitaniumSDK4.1.1ReleaseNote-AboutThisRelease\">About This Release</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_4.1.1_Release_Note-section-src-46239779_TitaniumSDK4.1.1ReleaseNote-FixedIssues\">Fixed Issues</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_4.1.1_Release_Note-section-src-46239779_TitaniumSDK4.1.1ReleaseNote-APIChanges\">API Changes</a>    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-46239779_TitaniumSDK4.1.1ReleaseNote-AboutThisRelease\">\n        <h2 class=\"heading \"><span>About This Release</span></h2>\n    <p>Titanium SDK 4.1.1 is a patch release of the SDK, addressing high-priority issues from previous releases.    </p>\n    <p>    <span id=\"src-46239779_issues\"><a name=\"src-46239779_issues\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-46239779_TitaniumSDK4.1.1ReleaseNote-FixedIssues\">\n        <h2 class=\"heading \"><span>Fixed Issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-18902\" target=\"_blank\">TIMOB-18902</a> Unable to set content-type as JSON for multipart post request using HTTPClient    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19102\" target=\"_blank\">TIMOB-19102</a> iOS: Map Crashes with SIGSEGV if you add a vector to a map with no mapType set    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19209\" target=\"_blank\">TIMOB-19209</a> iOS: ListView randomly not shown since 4.1.x    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19214\" target=\"_blank\">TIMOB-19214</a> iOS: Regression: TiUIImageView.images property crashes app in 4.1.0.GA    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19215\" target=\"_blank\">TIMOB-19215</a> Events on Map Annotation do not fire    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19232\" target=\"_blank\">TIMOB-19232</a> iOS: headerView/footerView in ListView disappears on half swipe back    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19249\" target=\"_blank\">TIMOB-19249</a> iOS: ListView randomly crashes the App    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19303\" target=\"_blank\">TIMOB-19303</a> iOS: Building modules errors out due to &apos;unknown type name &apos;UIView&apos;&apos;    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19314\" target=\"_blank\">TIMOB-19314</a> Android Map doesn&apos;t compile with 4.1.0.GA    </p>\n</li></ul>    <p>    <span id=\"src-46239779_apichanges\"><a name=\"src-46239779_apichanges\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-46239779_TitaniumSDK4.1.1ReleaseNote-APIChanges\">\n        <h2 class=\"heading \"><span>API Changes</span></h2>\n    <p>No APIs were modified for this release.    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46239779\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Titanium SDK 4.1.1 Release Note"});